import "./Header.css"; // Make sure this file exists in the same folder

const Header = () => {
  // Function to handle heart click
  const handleHeartClick = () => {
    alert("Heart icon clicked!");
  };

  return (
    <header className="header">
      {/* Logo Section */}
      <div className="logo">SHOPPER</div>

      {/* Navigation Section */}
      <nav className="nav">
        <ul className="nav-links">
          <li>Shop</li>
          <li>Mens</li>
          <li>Women</li>
          <li>Kids</li>
        </ul>
      </nav>

      {/* Actions Section */}
      <div className="actions">
        {/* Login Button */}
        <button className="login-btn">Login</button>

        {/* Heart Icon */}
        <div className="heart-container" onClick={handleHeartClick}>
          ‚ù§Ô∏è {/* Heart Icon */}
        </div>

        {/* Cart Icon */}
        <div className="cart-container">
          üõí <span className="cart-count">0</span>
        </div>
      </div>
    </header>
  );
};

export default Header;
